import { useEffect } from "react";
import api from "../../api";


const FeedBack = (props) => {


    useEffect(() => {
        const fetchData = async () => {
            
                const response = await api.get(`feedbacks/${props.planId}`);
                console.log(response.data.success[0].comment);
            
            
        }
        fetchData();
    });
    return (
        <div>
            {props.planId}
        </div>

    );

}



export default FeedBack;
